import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TopGamers = () => {
    const [gamers, setGamers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchGamers = async () => {
            try {
                const response = await axios.get('https://valyriansteelchallenge.onrender.com/top-gamers');
                setGamers(response.data);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchGamers();
    }, []);

    if (loading) return <p>Loading...</p>;
    if (error) return <p>Error: {error}</p>;

    return (
        <div>
            <h1>Top Gamers</h1>
            <table>
                <thead>
                    <tr>
                        <th>Team Name</th>
                        <th>College Name</th>
                        <th>Total Score</th>
                    </tr>
                </thead>
                <tbody>
                    {gamers.map(gamer => (
                        <tr key={gamer._id}>
                            <td>{gamer.teamname}</td>
                            <td>{gamer.collegename}</td>
                            <td>{gamer.totalScore}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default TopGamers;
